// InsurancePensionPlanClaim defines model for InsurancePensionPlanClaim.
type InsurancePensionPlanClaim struct {
	// EventInfo Dados Gerais do Evento Gerador
	EventInfo struct {
		// EventAlertDate Data de Aviso do Evento Gerador
		EventAlertDate timeutil.BrazilDate `json:"eventAlertDate"`

		// EventRegisterDate Data do Registro de Aviso  Seguradora
		EventRegisterDate timeutil.BrazilDate `json:"eventRegisterDate"`

		// EventStatus Status do Evento Gerador
		EventStatus InsurancePensionPlanClaimEventInfoEventStatus `json:"eventStatus"`
	} `json:"eventInfo"`

	// IncomeInfo Informacoes de Renda Concedida (caso renda tenha sido concedida)
	IncomeInfo *struct {
		// BeneficiaryBirthDate Data de nascimento do beneficirio da renda concedida
		BeneficiaryBirthDate timeutil.BrazilDate `json:"beneficiaryBirthDate"`

		// BeneficiaryCategory Classificao do Beneficirio
		BeneficiaryCategory InsurancePensionPlanClaimIncomeInfoBeneficiaryCategory `json:"beneficiaryCategory"`

		// BeneficiaryDocTypeOthers Descricao do campo de Tipo de Documento do Beneficiario quando a opcao escolhida for OUTROS
		BeneficiaryDocTypeOthers *string `json:"beneficiaryDocTypeOthers,omitempty"`

		// BeneficiaryDocument Documento de identificao do beneficirio da renda concedida
		BeneficiaryDocument string `json:"beneficiaryDocument"`

		// BeneficiaryDocumentType Tipo de Documento do Beneficirio
		BeneficiaryDocumentType InsurancePensionPlanClaimIncomeInfoBeneficiaryDocumentType `json:"beneficiaryDocumentType"`

		// BeneficiaryName Nome do beneficirio da renda concedida
		BeneficiaryName string `json:"beneficiaryName"`

		// BenefitAmount Nmero de benefcios a serem recebidos por ano
		BenefitAmount int `json:"benefitAmount"`

		// GrantedDate Data de Concesso
		GrantedDate timeutil.BrazilDate `json:"grantedDate"`

		// IncomeAmount Valor do benefcio concedido em forma de renda ou do pagamento nico
		IncomeAmount AmountDetails `json:"incomeAmount"`

		// IncomeType Tipo de Renda
		IncomeType InsurancePensionPlanClaimIncomeInfoIncomeType `json:"incomeType"`

		// IncomeTypeDetails Descrio do Tipo de Renda, obrigatrio se campo Tipo de Renda for OUTROS.
		IncomeTypeDetails *string `json:"incomeTypeDetails,omitempty"`

		// LastUpdateDate Data da ltima atualizao do benefcio
		LastUpdateDate timeutil.BrazilDate `json:"lastUpdateDate"`

		// MonetaryUpdIndexOthers Descricao do campo de Indice de Atualizacao Monetaria quando a opcao escolhida for OUTROS
		MonetaryUpdIndexOthers *string `json:"monetaryUpdIndexOthers,omitempty"`

		// MonetaryUpdateIndex ndice de Atualizao Monetria
		MonetaryUpdateIndex InsurancePensionPlanClaimIncomeInfoMonetaryUpdateIndex `json:"monetaryUpdateIndex"`

		// PaymentTerms Prazo pagamento da parcela ou da renda atuarial ou financeira do benefcio concedido (quando Tipo de renda for igual a 2, 3, 4, 5 e 6)
		PaymentTerms *string `json:"paymentTerms,omitempty"`

		// ReversedIncome Renda Revertida, obrigatorio se campo Tipo de Renda for 4, 6, 8, 9, 11 e 12.
		ReversedIncome *bool `json:"reversedIncome,omitempty"`
	} `json:"incomeInfo,omitempty"`
}

